angular.module("wt.editor.tpl").run(["$templateCache",function(e){e.put("wt-editor/editor.html",'<div class="wt-editor {{vm.className}}" ng-class="{true: \'wt-editor-full-screen\', false: \'\'}[vm.isFullscreen]">\r\n    <div class="wt-editor-toobar">\r\n        <div class="noselect">\r\n            <ul class="wtEditorToolBarUl">\r\n                <li class="wtEditorToolBarli" ng-repeat="item in vm.toolbars track by $index" name="{{item.name}}" ng-class="(item.id == 0 && vm.header_action)?\'active\':\'\'">\r\n                    <!--自定义toolbar-->\r\n                    <i ng-if="item.type === \'custom\'" title="{{item.title}}" class="{{item.className}} toolbar-icon"  ng-click="item.action($event,vm)"></i>\r\n\r\n                    <i ng-if="item.type === \'headingFns\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" ng-click="vm.setHeaderLi(item.id)"></i>\r\n\r\n                    <div ng-if="item.type === \'headingFns\'" ng-show="vm.header_action" class="toolbar-menu" flag="h">\r\n                        <ul flag="h">\r\n                            <li ng-repeat="n in vm.headers" ng-class="n.className" ng-click="vm.styleFn(n.name,$event)" flag="h">\r\n                                {{n.title}}\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n\r\n                    <i ng-if="item.type === \'styleFn\'" title="{{item.title}}" class="{{item.className}} toolbar-icon"  ng-click="vm.styleFn(item.name,$event)"></i>\r\n                    <!--<i ng-if="item.type === \'headingFn\'" title="{{item.title}}" class="{{item.className}} toolbar-icon"  ng-click="vm.styleFn(item.name,$event)">h{{item.level}}</i>-->\r\n\r\n                    <i ng-if="item.type === \'tableFn\'" title="{{item.title}}" class="{{item.className}} toolbar-icon"\r\n                       ng-click="vm.styleFn(item.name,$event)"></i>\r\n\r\n\r\n                    <div ng-if="item.type === \'tableFn\'" ng-show="vm.table_action" class="table-menu" flag="table" ng-mouseleave="vm.tableActiveX=1;vm.tableActiveY=1;vm.table_action=false">\r\n                        <ul flag="table">\r\n                            <li flag="table" ng-repeat="n in vm.tableMenu">\r\n                                <i ng-repeat="s in n" flag="table" ng-click="vm.insertTable()" ng-mouseenter="vm.setTableMemu(s[0],s[1])" ng-mouseleave="" ng-class="{true: \'active\', false: \'\'}[s[0]<=vm.tableActiveX && s[1] <= vm.tableActiveY]"></i>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n\r\n\r\n                    <i ng-if="item.type === \'emoji\'" title="{{item.title}}" class="{{item.className}} toolbar-icon"  data-toggle="modal" data-target="#{{item.target}}"></i>\r\n\r\n                    <i ng-if="item.type === \'mathFn\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" ng-click="vm.styleFn(item.name,$event)"></i>\r\n                    <i ng-if="item.type === \'flowchart\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" ng-click="vm.styleFn(item.name,$event)"></i>\r\n                    <i ng-if="item.type === \'diagram\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" ng-click="vm.styleFn(item.name,$event)"></i>\r\n                    <i ng-if="item.type === \'gantt\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" ng-click="vm.styleFn(item.name,$event)"></i>\r\n                    <i ng-if="item.type === \'help\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" data-toggle="modal" data-target="#{{item.target}}"></i>\r\n                    <i ng-if="item.type === \'preview\'" title="{{item.title}}" class="{{item.className}} toolbar-icon" ng-click="vm.togglePreview()"></i>\r\n                    <i ng-if="item.type === \'expand\'" title="{{vm.isFullscreen?item.title2:item.title}}" class="{{item.className}} toolbar-icon" ng-class="{true: \'fa-compress\', false: \'fa-expand\'}[vm.isFullscreen]" ng-click="vm.toggleFullScreen()"></i>\r\n                    <i ng-if="item.type === \'divider\'" class="divider"></i>\r\n                </li>\r\n            </ul>\r\n        </div>\r\n    </div>\r\n    <div class="wt-editor-container" ng-class="{true:\'height-auto\',false:\'\'}[vm.autoHeight]">\r\n        <div class="wt-editor-container-code">\r\n            <textarea class="wt-editor-textarea" msd-elastic thy-model="value" max-height="maxHeight"></textarea>\r\n        </div>\r\n        <div class="wt-editor-container-preview" ng-style="vm.editorHeight" ng-show="vm.isPreview">\r\n            <article class="markdown-body" data-open-title="Hide Preview" data-closed-title="Show Preview"></article> <!-- 实时预览 -->\r\n        </div>\r\n    </div>\r\n</div>\r\n')}]);